import React, { useState } from 'react';
import { QElementComponent, useQElementResponsive } from '../qelements';

/**
 * Responsive Template - Responsive Design System
 * 
 * This template demonstrates QElements responsive capabilities:
 * - Breakpoint-based styling
 * - Responsive layouts
 * - Adaptive components
 * - Mobile-first design
 * 
 * Edit this template to experiment with responsive design!
 */

const ResponsiveTemplate = () => {
  const { createResponsiveStyle } = useQElementResponsive('responsive_template');
  const [breakpoint, setBreakpoint] = useState('desktop');

  const responsiveConfigs = {
    mobile: { 
      padding: 10, 
      fontSize: 14, 
      flexDirection: 'column' as const,
      gap: 8,
      width: '100%'
    },
    tablet: { 
      padding: 15, 
      fontSize: 16, 
      flexDirection: 'row' as const,
      gap: 12,
      width: '50%'
    },
    desktop: { 
      padding: 20, 
      fontSize: 18, 
      flexDirection: 'row' as const,
      gap: 16,
      width: '33.333%'
    }
  };

  const handleBreakpointChange = (bp: string) => {
    setBreakpoint(bp);
    createResponsiveStyle({
      mobile: responsiveConfigs.mobile,
      tablet: responsiveConfigs.tablet,
      desktop: responsiveConfigs.desktop
    });
  };

  return (
    <div style={{ marginBottom: '2rem' }}>
      <h3>üì± Responsive Template - Responsive Design</h3>
      <p>Responsive layouts that adapt to different screen sizes.</p>

      {/* Responsive Controls */}
      <div style={{ marginBottom: '1rem', display: 'flex', gap: '10px', flexWrap: 'wrap' }}>
        <button onClick={() => handleBreakpointChange('mobile')}>
          üì± Mobile View
        </button>
        <button onClick={() => handleBreakpointChange('tablet')}>
          üì± Tablet View
        </button>
        <button onClick={() => handleBreakpointChange('desktop')}>
          üñ•Ô∏è Desktop View
        </button>
      </div>

      {/* Responsive Container */}
      <QElementComponent elementId="responsive_template" style={{ 
        display: 'flex', 
        gap: 10, 
        padding: 20, 
        backgroundColor: '#f8f9fa',
        borderRadius: 8,
        border: '2px solid #dee2e6',
        flexWrap: 'wrap'
      }}>
        <h4>Responsive Container ({breakpoint})</h4>
        <p>I adapt my layout based on the current breakpoint.</p>

        {/* Responsive Cards */}
        <QElementComponent elementId="responsive_template" style={{ 
          backgroundColor: '#e3f2fd', 
          padding: 15, 
          borderRadius: 4,
          flex: 1,
          minWidth: '200px'
        }}>
          <h5>Card 1</h5>
          <p>Responsive design in action!</p>
          <small>Breakpoint: {breakpoint}</small>
        </QElementComponent>

        <QElementComponent elementId="responsive_template" style={{ 
          backgroundColor: '#f3e5f5', 
          padding: 15, 
          borderRadius: 4,
          flex: 1,
          minWidth: '200px'
        }}>
          <h5>Card 2</h5>
          <p>Layout adapts automatically!</p>
          <small>Breakpoint: {breakpoint}</small>
        </QElementComponent>

        <QElementComponent elementId="responsive_template" style={{ 
          backgroundColor: '#e8f5e8', 
          padding: 15, 
          borderRadius: 4,
          flex: 1,
          minWidth: '200px'
        }}>
          <h5>Card 3</h5>
          <p>Responsive inheritance!</p>
          <small>Breakpoint: {breakpoint}</small>
        </QElementComponent>
      </QElementComponent>

      {/* Responsive Info */}
      <div style={{ 
        marginTop: '20px', 
        padding: '15px', 
        backgroundColor: '#f8f9fa', 
        borderRadius: '8px',
        border: '1px solid #dee2e6'
      }}>
        <h5>Current Responsive Config:</h5>
        <pre style={{ fontSize: '12px', background: '#ffffff', padding: '10px', borderRadius: '4px' }}>
          {JSON.stringify(responsiveConfigs[breakpoint as keyof typeof responsiveConfigs], null, 2)}
        </pre>
      </div>
    </div>
  );
};

export default ResponsiveTemplate;
